import Tabs from '../components/Tabs';
import { Row, Col, Form } from 'react-bootstrap';
import LandingPageFeaturedShillers from './LandingPage/LandingPageFeaturedShillers';
import LandingPageFeaturedTokens from './LandingPage/LandingPageFeaturedTokens';
import styled from 'styled-components';
import Button from '../components/Button';

const Filter = () => {
    return (
        <div style={{display: 'grid', gap: '32px'}}>
            <FilterSection>
                <BiggerH4>Average price range</BiggerH4>
                <div style={{display: 'grid', gap: '12px', gridAutoFlow: 'column'}}>
                    <Input placeholder="0.00"></Input>
                    <Input placeholder="0.00"></Input>
                </div>
                <Button variant="secondary" style={{width: '100%'}}>Set price</Button>
            </FilterSection>
            <FilterSection style={{gap: '32px'}}>
                <div>
                     <div style={{display: 'flex'}}>
                        <box-icon type='logo' name='tiktok'></box-icon>
                        <BiggerH4 style={{marginLeft: '8px'}}>Tiktok Followers</BiggerH4>
                     </div>
                </div>
                <div>
                     <div style={{display: 'flex'}}>
                        <box-icon type='logo' name='instagram'></box-icon>
                        <BiggerH4 style={{marginLeft: '8px'}}>Instagram Followers</BiggerH4>
                     </div>
                </div>
                <div>
                     <div style={{display: 'flex'}}>
                        <box-icon type='logo' name='youtube'></box-icon>
                        <BiggerH4 style={{marginLeft: '8px'}}>YouTube Subscribers</BiggerH4>
                     </div>
                </div>
            </FilterSection>
            <FilterSection>
                <BiggerH4>Reviews</BiggerH4>
                <SelectOption>
                        <BiggerH4 style={{color: 'var(--accent-warning)'}}>5</BiggerH4>
                        <box-icon type='solid' name='star' color='var(--accent-warning)' style={{marginLeft: '4px'}}></box-icon>
                </SelectOption>
            </FilterSection>
            {/* <Form>
                {['Average Price Range','Tiktok Followers', 'Instagram Followers', 'YouTube Subscribers'].map((label) => (
                    <>
                        <Form.Label className='me-auto'>{label}</Form.Label>
                        <Row className="mb-3">
                            <Form.Group as={Col}>
                                <Form.Control type="number" placeholder="Min" />
                            </Form.Group>

                            <Form.Group as={Col}>
                                <Form.Control type="number" placeholder="Max" />
                            </Form.Group>
                        </Row>
                    </>
                ))}
                <Row className="mb-3">
                    {['5', '4','3'].map((label) => (
                        <div key={`default-${label}`} className="border rounded-3 p-2 mb-3">
                            <Form.Check
                                type='radio'
                                id={`default-${label}`}
                                label={`${label} ⭐️ and more!`}
                            />
                        </div>
                    ))}
                </Row>

            </Form> */}
        </div>
    )
}

export const ExplorePage = () => {
    return (
        <div style={{maxWidth: '1200px', padding: '0 16px', paddingTop: '24px'}}>
            <Tabs> 
                <div label="Shillers"> 
                    <ExploreShillers />
                </div> 
                <div label="Tokens"> 
                    <ExploreTokens />
                </div> 
            </Tabs> 
        </div>
    )
}

const ExploreShillers = () => {
    return (
        <Row style={{paddingTop: '32px'}}>
            <Col md={3}>
                <Filter />
            </Col>
            <Col md={9}>
                Shiller cards here
            </Col>
        </Row>
    );
}

const ExploreTokens = () => {
    return (
        <Row style={{paddingTop: '32px'}}>
            <Col md={3}>
                <Filter />
            </Col>
            <Col md={9}>
                Token cards here
            </Col>
        </Row>
    );
}


export default ExplorePage

const BiggerH4 = styled.h4`
    font-size: 18px;
`;

const Input = styled.input`
    box-shadow: none;
    min-height: 60px;
    border-radius: var(--br-lg);
`;

const FilterSection = styled.div`
    display: grid;
    gap: 16px;
    padding-bottom: 32px;
    border-bottom: 1px solid var(--base-20);
`;

const SelectOption = styled.div`
    border-radius: var(--br-lg);
    border: 1px solid var(--base-30);
    padding: 20px;
    display: flex;
    align-items: center;
    cursor: pointer;

    &:hover {
        border: 1px solid var(--base-50);
    }
`;
